import React from "react";
import styles from "./userManageList.module.css"

function UserManageList() {

  const modClick = () => {
    prompt("제목", a, b, c);
  }
  return (
    <div className={styles.userManageSection}>
      <div className={styles.isCheck}>
        <input type="checkbox"></input>
      </div>
      <div className={styles.uId}>2134-1234</div>
      <div className={styles.id}>abc123</div>
      <div className={styles.uName}>홍길동</div>
      <div className={styles.uEmail}>abc123@gachon.ac.kr</div>
      <div className={styles.uNum}>01012345678</div>
      <div className={styles.uAddr}>서울특별시 ~~구 ~~동 ~~</div>
      <div className={styles.modBtn}>
        <img onClick={modClick}
        src={require("../../images/mod.png")} alt="mod" />
      </div>
    </div>
  );
}

export default UserManageList
